import { BOARD_CELL, CELL_PADDING, CELL_SIZE, CEll_ROUND } from "./config";
import { Point } from "./snake";

var myImage = new Image();
    myImage.src = "data:image/png;base64,";


export function initBoard(ctx: CanvasRenderingContext2D, cellSize: number, gridSize: number) {  
        for (let row = 0; row < gridSize; row++) {
            for (let coll = 0; coll < gridSize; coll++) {
                drawCell(ctx, cellSize, {x: row, y: coll})
            }
        }
    }

export  function drawCell(ctx: CanvasRenderingContext2D, cellSize: number, point: Point, color = BOARD_CELL) {
    const {x: xPosition, y: yPosition, char } = point;

    const x = xPosition * cellSize + CELL_PADDING;
    const y = yPosition * cellSize + CELL_PADDING;

    ctx.clearRect(x * cellSize, y * cellSize, cellSize, cellSize);

    ctx.beginPath();
    ctx.roundRect(x, y, cellSize - CELL_PADDING, cellSize - CELL_PADDING,[CEll_ROUND]);
    ctx.fillStyle = color;
    ctx.fill();

    if(char) {
        ctx.fillStyle = 'black';
        ctx.font = "20px serif";
        ctx.fillText(char, x + 15, y + 30);
    }
}


export  function drawImageCell(ctx: CanvasRenderingContext2D, cellSize: number, point: Point) {
    const {x: xPosition, y: yPosition, char } = point;

    const x = xPosition * cellSize + CELL_PADDING;
    const y = yPosition * cellSize + CELL_PADDING;

    
    ctx.drawImage(myImage, x, y, cellSize - 3, cellSize - 3);
}


